public boolean load(InputStream input) throws IOException {
  DataInputStream in = new DataInputStream(input);
  TSTNode root = trie.new TSTNode('\0', null);
  try {
    readRecursively(in, root);
    trie.setRoot(root);
  } finally {
    IOUtils.close(in);
  }
  return true;
}

